official_world_language=Skaparen av detta tillägg vill bjuda in dig att betänka (och främja) idén om ett officiellt <a class="text-link" target="_blank" href="http://sv.wikipedia.org/wiki/International_Auxiliary_Language_Association">internationellt hjälpspråk</a>, så att världens alla folk en dag skall kunna kommunicera med varandra från tidig ålder och ägna sin energi åt mer produktiva (så väl som förståelseökande och kostnadsbesparande) områden än att behöva lära sig ett flertal lingua franca (geografiskt specifika gemensamma huvudspråk) och därmed göra dem fria att göra andra saker, såsom studier av vilka lokala eller andra språk de kan tänkas vilja lära sig: <a class="text-link" target="_blank" href="http://onetongue.com">World Auxiliary Language website</a>.
